import React, { useState } from 'react';
import { fetchAPI, initUrl } from '../services/fetchData';

function Filter() {
    const [filter, setFilter] = useState({ name: '' });
    const [filterQueryResult, setFilterQueryResult] = useState({})
    const handleinputChange = (e) => {
        console.log(e.target.value)
        setFilter(e.target.value)
    }
    const handleQuery = () => {
        fetchAPI(`initUrl/${filter}`).then(() => {
            setFilterQueryResult
        })
    }
  return (
    <div className='filter-container'>
      <h3>Filter by Name</h3>
      <form onSubmit={handleQuery}>
        <input type='text' name='name' placeholder='Your Search Here' onChange={handleinputChange}/>
        <button type='submit' className='filter-btn'>
          Filter
        </button>
      </form>
      <button >Clear Filter</button>
    </div>
  );
}

export default Filter;
